  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:10.793821\",\n\t\"name\": \"mercury-in-largemouth-bass-of-the-lake-woodruff-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"From August 24 to 28, 1990, largemouth
  bass (Micropterus salmoides) were collected from selected locations at the Lake
  Woodruff National Wildlife Refuge, Volusia County, Florida for analysis of mercury
  concentrations in muscle tissue. The bass (n=40) were from 279 to 639 mm (11.0-25.2
  in) in total length. Mercury concentrations ranged from 0.02 to 1.02 mg/kg wet weight;
  ppm. Fifteen percent of the bass (n = 6) had mercury levels that exceeded the Florida
  limited-consumption concentration of 0.5 ppm wet weight. None of the bass exceeded
  Florida's nonconsumption concentration of 1.5 ppm. Although all the locations sampled
  (n=8) appeared to provide environments conducive for accumulation of mercury in
  bass, concentrations were greater (p < 0.05) at two sampling stations (Spring Garden
  Creek and Norris Dead River) than at other locations. Several fish and wildlife
  trust species may be at risk when utilizing the habitat areas sampled. Additional
  environmental contaminant studies to determine the scope, magnitude and effects
  of mercury contamination are recommended.\",\n\t\"license_title\": \"License Not
